contract Cacti is IERC20, Ownable {
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    string constant public name = "CACTI";
    string constant public symbol = "CACTI";
    uint8 constant public decimals = 18;

    uint256 private _totalSupply = 200 * 1e6 ether;

    address public marketingAddress;
    uint8 public feePercentage = 5;

    mapping (address => bool) public isExcludedFromFee;

    uint256 public blacklistValidUntil;
    mapping (address => bool) public isBlacklisted;
    address public uniswapV2Pair;

    BPContract public BP;
    bool public bpEnabled;
    bool public BPDisabledForever;
    

    event TransferFee(address sender, address recipient, uint256 amount);
    event SetFeePercentage(uint8 feePercentage);
    event ExcludeFromFees(address address_);
    event IncludeInFees(address address_);
    event MarketingAddressChanged(address);

    constructor(address _uniRouter) {
        _balances[msg.sender] = _totalSupply;
        isExcludedFromFee[msg.sender] = true;
        blacklistValidUntil = block.timestamp + 3 days;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            _uniRouter
        );

        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());

    }

    function burn(uint256 amount) external {
        _burn(_msgSender(), amount);
    }

    function burnFrom(address account, uint256 amount) external {
        uint256 currentAllowance = _allowances[account][msg.sender];
        require(currentAllowance >= amount, "ERC20: burn amount exceeds allowance");
        unchecked {
            _approve(account, _msgSender(), currentAllowance - amount);
        }
            _burn(account, amount);
    }

    function transfer(address recipient, uint256 amount) external override returns (bool)  {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, _msgSender(), currentAllowance - amount);
        }

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) external returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) external returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        unchecked {
            _approve(_msgSender(), spender, currentAllowance - subtractedValue);
        }
        return true;
    }

    function totalSupply() external view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) external view override returns (uint256) {
        return _balances[account];
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(!isBlacklisted[sender] && !isBlacklisted[recipient], "The address is blacklisted");

        if (bpEnabled && !BPDisabledForever){
            BP.protect(sender, recipient, amount);
        }

        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balances[sender] = senderBalance - amount;
        }

        uint256 receiveAmount = amount;
        if (isExcludedFromFee[sender] || isExcludedFromFee[recipient]) {
            _balances[recipient] += receiveAmount;
        }
        else {
            uint256 feeAmount = amount * feePercentage / 100;
            receiveAmount = amount - feeAmount;
            _balances[marketingAddress] += feeAmount;
            _balances[recipient] += receiveAmount;
            emit Transfer(sender, marketingAddress, feeAmount);
        }

        emit Transfer(sender, recipient, receiveAmount);
    }

    function _burn(address account, uint256 amount) private {
        require(account != address(0), "ERC20: burn from the zero address");

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
    /* BP Contract Code */
    function multiBlacklist(address[] calldata addresses) external onlyOwner {
        require(block.timestamp < blacklistValidUntil, "blacklist is not availalbe anymore");
        for (uint256 i=0; i < addresses.length; i++) {
            require(addresses[i] != uniswapV2Pair, "Can't blacklist pair address");
            isBlacklisted[addresses[i]]  = true;
        }
    }

    function multiRemoveFromBlacklist(address[] calldata addresses) external onlyOwner {
        for (uint256 i=0; i < addresses.length; i++) {
            isBlacklisted[addresses[i]] = false;
        }
    }

    function setBPAddress(address _bp) external onlyOwner {
        BP = BPContract(_bp);
    }

    function setBpEnabled(bool _enabled) external onlyOwner {
        bpEnabled = _enabled;
    }

    function setBotProtectionDisableForever() external onlyOwner{
        require(BPDisabledForever == false);
        BPDisabledForever = true;
    }
    /* End of BP Contract Code */
    
    function setFeePercentage(uint8 feePercentage_) external onlyOwner {
        require(feePercentage_ <= 8, "Fee cannot be more than 5%");
        feePercentage = feePercentage_;
        emit SetFeePercentage(feePercentage);
    }

    function setMarketingAddress(address marketingAddress_) external onlyOwner {
        marketingAddress = marketingAddress_;
        emit MarketingAddressChanged(marketingAddress);
    }

    function excludeFromFee(address address_) external onlyOwner {
        isExcludedFromFee[address_] = true;
        emit ExcludeFromFees(address_);
    }

    function includeInFee(address address_) external onlyOwner {
        require(isExcludedFromFee[address_], "The address must be excluded from fees");
        isExcludedFromFee[address_] = false;
        emit IncludeInFees(address_);
    }

}
